uint64_t fibonacci::decode_prefix_sum(const uint64_t* data, const size_type start_idx, size_type n)
{
    if (n==0)
        return 0;
//	return decode<true,false,int*>(data, start_idx, n);
    data += (start_idx >> 6);
    size_type i = 0;
    int32_t	bits_to_decode = 0;
    uint64_t w = 0, value = 0;
    int16_t buffered = 0, read = start_idx & 0x3F, shift = 0;
    uint16_t temp=0;
    uint64_t carry=0;
    i = bit_magic::b11Cnt(*data & ~bit_magic::Li1Mask[read], carry);
    if (i<n) {
        uint64_t oldcarry;
        w = 0;
        do {
            oldcarry = carry;
            i += (temp = bit_magic::b11Cnt(*(data+(++w)), carry));
        } while (i<n);
        bits_to_decode += ((w-1)<<6) + bit_magic::i11BP(*(data+w), n-(i-temp), oldcarry) + 65 - read;
        w = 0;
    } else { // i>=n
        bits_to_decode = bit_magic::i11BP(*data >> read, n)+1;
    }
    if (((size_type)bits_to_decode) == n<<1) // TODO: comparison between unsigned and signed int
        return n;
    if (((size_type)bits_to_decode) == (n<<1)+1)
        return n+1;
    i = 0;
//	while( bits_to_decode > 0 or buffered > 0){// while not all values are decoded
    do {
        while (buffered < 64 and bits_to_decode > 0) {
            w |= (((*data)>>read)<<buffered);
            if (read >= buffered) {
                ++data;
                buffered += 64-read;
                bits_to_decode -= (64-read);
                read = 0;
            } else { // read buffered
                read += 64-buffered;
                bits_to_decode -= (64-buffered);
                buffered = 64;
            }
            if (bits_to_decode < 0) {
                buffered += bits_to_decode;
                w &= bit_magic::Li1Mask[buffered];
                bits_to_decode = 0;
            }
        }
        if (!i) { // try do decode multiple values
            if ((w&0xFFFFFF)==0xFFFFFF) {
                value += 12;
                w >>= 24;
                buffered -= 24;
                if ((w&0xFFFFFF)==0xFFFFFF) {
                    value += 12;
                    w >>= 24;
                    buffered -= 24;
                }
            }
            do {
                temp = Fib2bin_0_16_greedy[w&0xFFFF];
                if ((shift=(temp>>11)) > 0) {
                    value += (temp & 0x7FFULL);
                    w >>= shift;
                    buffered -= shift;
                } else {
                    value += Fib2bin_0_95[w&0xFFF];
                    w >>= 12;
                    buffered -= 12;
                    i = 1;
                    break;
//					goto decode_single;
                }
            } while (buffered>15);
        } else { // i > 0
//decode_single:
            value += Fib2bin_0_95[(i<<12) | (w&0xFFF)];
            shift  = Fib2binShift[w&0x1FFF];
            if (shift > 0) { // if end of decoding
                w >>= shift;
                buffered -= shift;
                i = 0;
            } else { // not end of decoding
                w >>= 12;
                buffered -= 12;
                ++i;
            }
        }
    } while (bits_to_decode > 0 or buffered > 0);
    return value;
}

uint64_t fibonacci::decode_prefix_sum(const uint64_t* data, const size_type start_idx, const size_type end_idx, size_type n)
{
    return decode_prefix_sum(data, start_idx, n);
}

